import React from "react";
import ProjectCard from "../components/ProjectCard";
import AliceCarousel from 'react-alice-carousel';
import 'react-alice-carousel/lib/alice-carousel.scss';
import Header from "../components/Header";
import "./Projects.css"
import Content from "../components/Content";
import simplyWeather from "../imgs/simplyweather.svg"

export default function Projects() {
    const responsive = {
        0: { items: 1 },
        568: { items: 2 },
        1024: { items: 3 },
    };

    let items = [
        <ProjectCard title={"Simply Weather"} image={simplyWeather} caption={"A weather app."} />
    ]

    return (
        <>
            <Header title={"Projects"} caption={"These are some of the projects that I've completed over the years.  Be sure to click through each one to get more info, view the final product, or view the code."} />
            <Content>
                <AliceCarousel mouseTracking items={items} responsive={responsive} />
            </Content>
        </>
    )
}
